window.bookSummaryJSON = "<p>Over 20 years have passed since the events of <i>Warstrider: Symbionts</i>. Contact with the DalRiss and Naga, and their technology, has radically altered human society - as has the constant struggle between the Hegemony and the rebel Confederation for control over the dozens of human-inhabited planets. But the Hegemony has a new technology that could suppress any resistance to Earth's rule. </p> <p>Meanwhile Dev Cameron and the DalRiss have discovered a new threat emerging from deep space: one that could cause the extinction of all life it encounters. </p>"; 
